import React, { PureComponent } from "react";
import "./App.css";
import { cycleData, nnData, baseData, totalData } from "./memoryData";
import MemoryBarChart from "./MemoryBarChart";
import MemoryPieChart from "./MemoryPieChart";

export default class Main extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/90v76x08/";

  formatDataForPie = dataKey => {};

  render() {
    return (
      <div className="chartsContainer">
        <div className="barCharts">
          <MemoryBarChart
            title={"Common memory overhead"}
            data={baseData}
            heavyFillColor="#fcba03"
            lightFillColor="#ffe18f"
          />
          <MemoryBarChart
            title={"Cyclic sensor memory footprint"}
            data={cycleData}
            heavyFillColor="#199c52"
            lightFillColor="#82ca9d"
          />
          <MemoryBarChart
            title={"Neural Network memory consumption"}
            data={nnData}
            heavyFillColor="#65bfe0"
            lightFillColor="#b3e8fc"
          />
        </div>
        <div className="totalChart">
          <MemoryBarChart
            title={"Total Program memory usage at compile time"}
            data={totalData}
            heavyFillColor="#a600ff"
            lightFillColor="#e5b5ff"
          />
          <MemoryPieChart
            title={"Total Program memory usage at compile time"}
            data={[baseData]}
            colors={["#0088FE", "#00C49F", "#FFBB28", "#FF8042"]}
          />
          <MemoryPieChart
            title={"Total Program memory usage at compile time"}
            colors={["#0088FE", "#00C49F", "#FFBB28", "#FF8042"]}
          />
        </div>
      </div>
    );
  }
}
